INSERT INTO `ticket_itens_rarity` (`id`, `item`, `lore`, `price`, `print`, `rarity`) VALUES
	(1, 'Bigorna Danificada', 'A Bigorna Danificada é um objeto repleto de história e mistério, carregando em suas marcas e rachaduras as memórias de um passado glorioso. Dizem que ela já foi a ferramenta principal de um lendário ferreiro conhecido como Theros Ferrobrando, cujas criações eram tão excepcionais que até os deuses invejavam sua habilidade.\r\n\r\nForjada nos vulcões da antiga Montanha Rubra, a bigorna era indestrutível, capaz de suportar o calor de mil fornalhas e o impacto de martelos encantados. Theros a usou para criar armas e armaduras que moldaram o destino de reinos inteiros. No entanto, em um fatídico dia, um poderoso inimigo apareceu: o dragão Ash\'Tarok, cujo fogo era quente o suficiente para derreter até as rochas mais resistentes.\r\n\r\nDurante a batalha épica entre o ferreiro e o dragão, Theros utilizou a bigorna como último recurso, invocando uma antiga magia para aprisionar a alma de Ash\'Tarok dentro de um elmo que ele estava forjando. Embora a magia tenha funcionado, o poder liberado foi devastador, danificando a bigorna para sempre. Suas bordas racharam, e sua superfície, antes polida e brilhante, ficou desgastada e marcada pelas chamas do dragão.\r\n\r\nAgora, a Bigorna Danificada repousa esquecida em uma oficina abandonada, esperando pelo dia em que outro mestre ferreiro possa restaurar sua glória e desbloquear os segredos ocultos em suas rachaduras. Aqueles que ousam usá-la dizem que ouvem sussurros de Theros e rugidos distantes de Ash\'Tarok, como se o passado ainda estivesse vivo dentro do metal.\r\n\r\nSeria a bigorna apenas uma ferramenta, ou um fragmento do destino esperando para ser desvendado?\r\n\r\nOriginal: 1', '220000', 'https://i.imgur.com/3xwSuF7.png', 'Comum'),
	(2, 'BCANT1N1', 'Cabeça de um membro banido!\r\nOriginal: 2', '350000', 'http://cravatar.eu/head/BCANT1N1/128.png', 'Raro'),
	(3, 'sonolwnto', 'Cabeça de um membro banido!\r\nOriginal: 5', '400000', 'http://cravatar.eu/head/sonolwnto/128.png', 'Raro'),
	(6, 'Thaynison', 'Cabeça do desenvolvedor do servidor!\r\nOriginal: 1', '1000000', 'http://cravatar.eu/head/EvelynBetteher/128.png', 'Raro'),
	(7, 'Grimório de Algodão', 'Um grimório antigo, envolto em mistério. Seus feitiços, feitos de fios de algodão encantados, permitem manipular sonhos e criar ilusões, sendo cobiçado por magos em busca de poder.', '150000', 'https://i.imgur.com/XznhP6K.png', 'Comum'),
	(8, 'Grimorio de Cristal', 'Capaz de canalizar e amplificar a magia Elemental. Sua superfície reflete luzes sobrenaturais e contém segredos que podem dominar os elementos da natureza.', '150000', 'https://i.imgur.com/BW2lRkS.png', 'Comum'),
	(9, 'Grimorio de Cobre', 'É um grimório forjado com cobre encantado, capaz de manipular energias metálicas e controlar forças elétricas. Seu poder se fortalece em contato com a terra, sendo um artefato valorizado por alquimistas.', '150000', 'https://i.imgur.com/G4BHxCX.png[', 'Comum'),
	(10, 'Grimorio de Bússola ', 'É um grimório mágico com uma bússola encantada em sua capa, capaz de guiar aqueles que o possuem através de dimensões e caminhos perdidos. Ele revela destinos ocultos e segredos ancestrais.', '150000', 'https://i.imgur.com/OIO13xt.png', 'Comum'),
	(11, 'Grimorio de Bolha', 'É um grimório encantado com a essência da água. Suas páginas flutuam como bolhas e contêm feitiços que manipulam a fluidez e a proteção. É um artefato procurado por místicos que buscam controle sobre as correntes elementares.', '150000', 'https://i.imgur.com/Pxy1cFo.png', 'Comum'),
	(12, 'Grimorio de Bronze', 'É um grimório forjado em bronze antigo, infundido com magia de proteção e resistência. Suas páginas revelam feitiços de fortificação e defesa, sendo um tesouro valorizado por guerreiros e guardiões.', '150000', 'https://i.imgur.com/96tdaSH.png', 'Comum'),
	(13, 'Grimorio de Briar', 'É um grimório envolto por espinhos encantados, conectando-se com as forças da natureza selvagem. Seus feitiços controlam plantas, venenos e armadilhas naturais, sendo cobiçado por druidas e mestres da flora.', '150000', 'https://i.imgur.com/RVUjn5p.png', 'Comum'),
	(14, 'Grimorio de Sangue', 'É um grimório sombrio, cujas páginas são tingidas com o sangue de antigos feiticeiros. Seus feitiços poderosos manipulam a essência vital, permitindo controlar a vida, a morte e o sangue dos inimigos. Cobiçado por necromantes e alquimistas.', '150000', 'https://i.imgur.com/2807xQB.png', 'Raro'),
	(15, 'Grimorio em Branco', 'É um grimório misterioso, com páginas completamente vazias. Dizem que ele se adapta ao usuário, revelando feitiços únicos baseados na alma de quem o possui. Um artefato enigmático e imprevisível.', '150000', 'https://i.imgur.com/LW4QpHD.png', 'Comum'),
	(16, 'Grimorio de Feral', 'É um grimório selvagem, coberto por peles e gravado com runas primitivas. Ele concede ao portador o poder de invocar criaturas ferozes e canalizar a força dos animais, despertando instintos predatórios.', '150000', 'https://i.imgur.com/JTksYbT.png', 'Comum'),
	(17, 'Grimorio das Cinzas', 'É um grimório envolto em cinzas, resquício de antigos incêndios mágicos. Suas páginas guardam feitiços de destruição e renascimento, capazes de transformar tudo em pó ou trazer nova vida das chamas.', '150000', 'https://i.imgur.com/t13W2r4.png', 'Comum'),
	(18, 'Grimorio de Anti-Magia', 'É um grimório paradoxal, criado para anular forças mágicas. Suas páginas emanam uma aura que silencia feitiços e desfaz encantamentos, tornando-o a arma definitiva contra usuários de magia.', '950000', 'https://i.imgur.com/3ck64Oo.png', 'Épico'),
	(19, 'Grimorio Espirito de Fogo', 'É um grimório etéreo, envolto por chamas espectrais que nunca se apagam. Ele contém feitiços que invocam espíritos de fogo ancestral, capazes de queimar almas e purificar a escuridão.', '250000', 'https://i.imgur.com/NFBrPaQ.png', 'Raro'),
	(20, 'Grimorio Espirito da Terra', 'É um grimório antigo, esculpido em pedra viva e pulsante com a energia do mundo. Ele abriga feitiços que invocam espíritos da terra, capazes de moldar montanhas e proteger com força impenetrável.', '250000', 'https://i.imgur.com/Qx9G8u7.png', 'Raro'),
	(21, 'Grimorio Espacial', 'É um grimório enigmático, cujas páginas parecem infinitas e brilham com constelações. Ele contém feitiços que distorcem espaço, permitindo teletransporte, criação de portais e manipulação dimensional.', '150000', 'https://i.imgur.com/506zbTq.png', 'Comum'),
	(22, 'Grimorio de Neve', 'É um grimório gelado, coberto por uma fina camada de gelo eterno. Suas páginas revelam feitiços que convocam nevascas, congelam inimigos e moldam o frio em formas perigosas e belas.', '150000', 'https://i.imgur.com/ePEdGeb.png', 'Comum'),
	(23, 'Grimorio de Fumaça', 'É um grimório envolto em uma névoa constante, com páginas que exalam o aroma de cinzas. Ele guarda feitiços que manipulam fumaça para confundir, ocultar e sufocar, tornando-o ideal para magos furtivos.', '150000', 'https://i.imgur.com/bmk5TbE.png', 'Comum'),
	(24, 'Grimorio de Barra', 'É um grimório afiado, com uma capa marcada por cortes mágicos. Suas páginas vibram com energia cortante, contendo feitiços que invocam lâminas etéreas capazes de fender qualquer obstáculo', '150000', 'https://i.imgur.com/I0dQmLI.png', 'Comum'),
	(25, 'Grimorio das Sombras', 'É um grimório envolto em trevas, cujas páginas absorvem a luz ao seu redor. Ele contém feitiços que controlam sombras, permitindo que o usuário se esconda, manipule escuridão e invoque criaturas sombrias.', '150000', 'https://i.imgur.com/GzKTQnh.png', 'Comum'),
	(26, 'Grimorio de Planta', 'É um grimório pulsante com vida vegetal, suas páginas entrelaçadas por vinhas e flores encantadas. Ele revela feitiços que controlam a flora, permitindo invocar plantas, curar com ervas e manipular a natureza ao redor.', '150000', 'https://i.imgur.com/5tnKx2W.png', 'Comum'),
	(27, 'Grimorio de Neblina', 'É um grimório envolto em uma névoa etérea e silenciosa. Suas páginas ondulam como vapor, revelando feitiços que controlam nevoeiros, obscurecem a visão e criam ilusões, confundindo aliados e inimigos.', '150000', 'https://i.imgur.com/YwiO1Cr.png', 'Comum'),
	(28, 'Grimorio de Espelho', 'É um grimório encantado com capas de vidro refletivo. Suas páginas mostram não apenas palavras, mas também visões alternativas, permitindo que o usuário enxergue dimensões paralelas e manipule reflexos para enganar e confundir.', '150000', 'https://i.imgur.com/TmzOH6T.png', 'Comum'),
	(29, 'Grimorio de Mercurio', 'É um grimório líquido, cujas páginas brilham com o brilho metálico do mercúrio. Ele contém feitiços que controlam o metal líquido, permitindo transformação, transmutação e manipulação de formas fluídas e mutáveis.', '150000', 'https://i.imgur.com/HCjbJ2z.png', 'Comum'),
	(30, 'Grimorio de Relâmpago', 'É um grimório envolto por uma eletricidade pulsante, suas páginas vibram com o poder dos raios. Ele contém feitiços que controlam tempestades, invocam relâmpagos e canalizam a energia elétrica para atacar ou proteger.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '150000', 'https://i.imgur.com/iA6vm47.png', 'Comum'),
	(31, 'Grimorio de Luz', 'É um grimório radiante, cujas páginas emanam uma luz suave e curativa. Ele guarda feitiços que manipulam a luz, criando ilusões brilhantes, cegando inimigos e trazendo clareza e cura aos corações sombrios.', '950000', 'https://i.imgur.com/un3lqtA.png', 'Épico'),
	(32, 'Grimorio Kotodama', 'É um grimório antigo, envolto em símbolos místicos que vibram com palavras sagradas. Ele contém feitiços baseados no poder da palavra, permitindo ao usuário invocar forças através da fala e manipular a realidade com o som de seus encantamentos.', '950000', 'https://i.imgur.com/tZvFXHt.png', 'Raro'),
	(33, 'Grimorio de Ferro', 'É um grimório forjado com páginas de ferro, impregnadas com magia de força e resistência. Seus feitiços controlam o metal, permitindo criar armaduras impenetráveis, fortalecer estruturas e invocar guerreiros de ferro.', '150000', 'https://i.imgur.com/kfT1S0W.png', 'Comum'),
	(34, 'Grimorio de Gelo', 'É um grimório gelado, com páginas que brilham com uma luz azulada e emanam uma aura de frio intenso. Seus feitiços controlam o gelo, permitindo congelar inimigos, criar estruturas de gelo e manipular o frio para ataques devastadores.', '150000', 'https://i.imgur.com/6GL6xac.png', 'Comum'),
	(35, 'Grimorio de Gravidade', 'É um grimório misterioso, com páginas que distorcem a realidade ao seu redor. Ele contém feitiços que manipulam a gravidade, permitindo levitar objetos, criar campos gravitacionais e até alterar o peso de seres vivos para controlar o ambiente de batalha.', '150000', 'https://i.imgur.com/rEpyjdV.png', 'Comum'),
	(36, 'Grimorio de Fogo', 'É um grimório flamejante, cujas páginas ardentes dançam com chamas eternas. Ele contém feitiços que dominam o fogo, permitindo invocar chamas devastadoras, criar escudos de calor e controlar o elemento ardente em todas as suas formas.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '150000', 'https://i.imgur.com/rRq52s3.png', 'Comum'),
	(37, 'Grimorio de Terra', 'É um grimório sólido, com páginas de pedra e runas gravadas profundamente. Ele contém feitiços que manipulam a terra, permitindo controlar rochas, criar terremotos e moldar o solo para defesa ou ataque, com o poder da natureza em sua essência.\r\n\r\n\r\n\r\n\r\n\r\n\r\n', '150000', 'https://i.imgur.com/Ctf92rX.png', 'Comum'),
	(38, 'Grimorio de Arvore do Mundo', 'É um grimório sagrado, cujas páginas são feitas de folhas e galhos de uma árvore mítica que conecta todos os reinos. Ele contém feitiços que invocam a força da natureza, curam, protegem e abrem portais para dimensões distantes, equilibrando o ciclo da vida.', '550000', 'https://i.imgur.com/KWrH7ti.png', 'Raro'),
	(39, 'Grimorio de Agua', 'É um grimório fluido, cujas páginas se movem como se fossem água corrente. Ele contém feitiços que manipulam o elemento líquido, permitindo controlar rios, criar tempestades e usar o poder das ondas para curar ou atacar com precisão e flexibilidade.', '150000', 'https://i.imgur.com/FD7VDc2.png', 'Comum'),
	(40, 'Grimorio de Vórtice', 'É um grimório enigmático, cujas páginas giram como um redemoinho de energia pura. Ele contém feitiços que manipulam forças centrífugas, criando tornados, distorcendo o espaço e puxando tudo para o epicentro de sua magia, controlando o caos com precisão.', '150000', 'https://i.imgur.com/7kzyiPW.png[', 'Comum'),
	(41, 'Grimorio de Vinhas', 'É um grimório vivo, cujas páginas são entrelaçadas com vinhas mágicas. Ele contém feitiços que controlam plantas trepadeiras, permitindo invocar raízes que aprisionam, curam com ervas e moldam o ambiente com a força da natureza selvagem.', '150000', 'https://i.imgur.com/9UWoqin.png', 'Comum'),
	(42, 'Grimorio de Vento', 'É um grimório etéreo, cujas páginas se movem suavemente como a brisa. Ele contém feitiços que controlam o vento, permitindo criar rajadas poderosas, invocar tornados e usar a leveza do ar para manipular o ambiente e os inimigos com agilidade.', '950000', 'https://i.imgur.com/imDrtOC.png', 'Épico'),
	(43, 'Grimorio de Armadilha', 'É um grimório sombrio, repleto de armadilhas mágicas e feitiços engenhosos. Suas páginas contêm encantamentos que criam armadilhas invisíveis, armam perímetros de segurança e confundem inimigos, prendendo-os em ilusões ou em mecanismos fatais.', '150000', 'https://i.imgur.com/shixi37.png', 'Comum'),
	(44, 'Grimorio de Fio', 'É um grimório delicado, com páginas que parecem feitas de fios finos e cintilantes. Ele contém feitiços que controlam fios mágicos, permitindo tecer encantamentos invisíveis, amarrar destinos e manipular objetos à distância com precisão e destreza.', '250000', 'https://i.imgur.com/5hgu4nE.png', 'Raro'),
	(45, 'Grimorio de Espada', 'É um grimório forjado com lâminas mágicas em suas páginas, emanando uma aura de combate. Ele contém feitiços que invocam espadas etéreas, aprimoram habilidades de luta e canalizam o poder do aço, permitindo ao usuário dominar a arte da guerra com magia cortante.', '150000', 'https://i.imgur.com/6kW7vdR.png', 'Comum'),
	(46, 'Grimorio de Pedra', 'É um grimório robusto, com páginas feitas de pedra ancestral e cobertas por runas antigas. Ele contém feitiços que manipulam rochas e minerais, permitindo criar armaduras impenetráveis, levantar montanhas e controlar o terreno com a força bruta da terra.', '150000', 'https://i.imgur.com/5ydGyC7.png', 'Comum'),
	(47, 'Grimorio de Aço', 'É um grimório imponente, com páginas de aço endurecido, vibrando com poder. Ele contém feitiços que controlam o metal, permitindo criar armas invulneráveis, fortalecer defesas e invocar correntes de aço, tornando o usuário quase indestrutível em batalha.', '150000', 'https://i.imgur.com/JXs1Z5R.png', 'Comum'),
	(48, 'Grimorio Espirito da Agua', 'É um grimório etéreo, cujas páginas fluem como correntes aquáticas, imbuídas com a essência dos espíritos da água. Ele contém feitiços que invocam águas espirituais para curar, purificar e proteger, além de controlar ondas místicas e criar barreiras aquáticas com poder sobrenatural.', '250000', 'https://i.imgur.com/1dDd2aB.png', 'Raro'),
	(49, 'Lança de Sangue', 'É uma arma sombria e poderosa, forjada com a essência do sangue. Sua lâmina é composta de sangue coagulado e pode ser manipulada pelo usuário, permitindo ataques devastadores que drenam a vida dos inimigos. Usada por mestres da necromancia ou guerreiros amaldiçoados, ela se fortalece a cada gota de sangue derramado.', '190000', 'https://i.imgur.com/taphoO1.png', 'Raro'),
	(50, 'Lança de Demônio', 'É uma arma infernal, forjada nas profundezas do abismo. Sua lâmina ardente exala uma aura demoníaca, capaz de cortar através de qualquer resistência. Os ataques com a lança invocam chamas negras e maldições, marcando seus inimigos com um selo de fogo eterno. Somente aqueles que desafiaram as forças do inferno podem controlar seu poder destrutivo.', '190000', 'https://i.imgur.com/6HNVfLp.png', 'Raro'),
	(51, 'Lança de Chamas do Céu', 'É uma lança celestial, forjada com o fogo dos céus. Sua lâmina brilha com chamas etéreas que podem rasgar os ventos e incendiar o ar. Ao ser empunhada, a lança invoca tempestades de fogo, criando rajadas flamejantes que caem do céu como meteoros. Usada por aqueles que buscam equilibrar o poder do fogo e dos ventos, ela é um símbolo de destruição e renascimento.', '190000', 'https://i.imgur.com/FAgawO1.png', 'Raro'),
	(52, 'Lança do Espirito Zefero', 'É uma lança mística forjada com o poder dos ventos. Sua lâmina leve como uma brisa é capaz de cortar o ar com precisão mortal. Quando empunhada, invoca correntes de vento, permitindo ataques rápidos e imprevisíveis, além de criar tornados que desorientam os inimigos. É uma arma usada por guerreiros que dominam os elementos do ar, canalizando sua força em combate ágil e feroz.', '220000', 'https://i.imgur.com/UhEQ5JT.png', 'Raro'),
	(53, 'Matadora de Demônios', 'É uma arma lendária, forjada para destruir as criaturas das sombras. Sua lâmina é imbuída com a essência da luz celestial, capaz de cortar através da carne demoníaca e purificar a escuridão. Usada por caçadores de demônios e paladinos, a espada emite um brilho intenso ao se aproximar de seres infernais, tornando-a a ferramenta definitiva na luta contra as forças do mal. Cada golpe desfaz a corrupção, trazendo justiça e equilíbrio ao mundo.', '220000', 'https://i.imgur.com/U5lJdY5.png', 'Raro'),
	(54, 'Tesouro Sagrado Rhitta', 'É um artefato divino de origem ancestral, forjado pelos deuses para proteger os reinos da destruição. Sua forma, majestosa e imponente, é revestida com pedras preciosas e runas sagradas que brilham com luz celestial. Concedendo imenso poder a quem o empunha, o Tesouro Sagrado Rhitta pode invocar a força dos elementos e curar os mais graves ferimentos. Seu propósito é resguardar o equilíbrio entre os mundos, sendo protegido por uma ordem secreta de guardiões e utilizado apenas em momentos de necessidade extrema.', '320000', 'https://i.imgur.com/ixmrMz9.png', 'Raro'),
	(55, 'Tesouro Sagrado Lostvayne', 'É um artefato místico e poderoso, perdido nas brumas do tempo. Forjado com a essência de antigas civilizações, sua aparência é imponente, adornada com símbolos arcanos e pedras raras que emanam uma energia pura e intensa. Esse tesouro concede ao portador a habilidade de manipular a magia primordial e invocar forças imbatíveis, mas exige grande coragem e sacrifício para ser controlado. Perdido por eras, o Lostvayne é cobiçado por heróis e vilões, sendo considerado a chave para desvendar segredos cósmicos e alcançar o poder absoluto.', '320000', 'https://i.imgur.com/s8HE7LM.png', 'Raro'),
	(56, 'Tesouro Sagrado Chastiefol', 'É uma lança mítica e divina, forjada pelos deuses para proteger os reinos da destruição. Sua lâmina, feita de um metal raro e imortal, possui uma habilidade única de mudar de forma, adaptando-se à necessidade do momento — seja como uma lança afiada, um escudo de defesa ou uma barreira de ataque em massa. O Chastiefol é imbuído com a força elemental da terra e do vento, concedendo ao portador o poder de invocar tempestades e causar terremotos. Usada por guerreiros e heróis escolhidos, esta lança é a chave para combater os maiores inimigos e restaurar o equilíbrio entre os mundos.', '320000', 'https://i.imgur.com/L7Rf33p.png', 'Raro'),
	(57, 'Tesouro Sagrado Aldan', 'É uma joia mágica de incomensurável poder, forjada no coração das estrelas. Sua forma é um cristal radiante que brilha com uma luz cósmica, capaz de manipular o espaço e o tempo. Ao ser empunhado, o Aldan concede ao portador habilidades de teletransporte, controle sobre dimensões paralelas e uma visão clara do futuro e do passado. Sua energia é tanto curativa quanto destrutiva, tornando-o uma ferramenta divina para a batalha ou para a proteção dos reinos. Guardado em segredo por uma ordem de sábios, o Tesouro Sagrado Aldan é considerado o elo entre o presente e o destino, capaz de mudar o curso da história.', '320000', 'https://i.imgur.com/QAOQhAS.png', 'Raro'),
	(58, 'Representação da Natureza e da Sociedade', 'É um artefato simbólico que une os dois pilares fundamentais da existência humana e do mundo natural. Forjado com materiais extraídos de lugares sagrados da Terra, esse item possui formas intricadas que refletem tanto os ciclos da natureza quanto as estruturas sociais. A parte ligada à natureza é adornada com elementos como folhas, pedras e água, representando o equilíbrio ecológico e os elementos essenciais para a vida. Já a seção referente à sociedade é composta por metais refinados e símbolos de civilizações antigas, refletindo os valores, culturas e organizações humanas.\r\n\r\nEsse item possui o poder de harmonizar a relação entre o homem e o ambiente, promovendo a coexistência pacífica, e pode conceder ao portador a habilidade de restaurar o equilíbrio entre o mundo natural e a sociedade. Quando usado corretamente, pode trazer prosperidade, justiça e renovação ao mundo.', '100000000', 'https://i.imgur.com/OnqaLXZ.png', 'Divino'),
	(59, 'Ginnungagap', 'É um artefato cósmico de poder primordial, inspirado no abismo primordial da mitologia nórdica. Representando o vazio entre os mundos de fogo e gelo, o Ginnungagap contém a essência das forças cósmicas em seu estado mais bruto e puro. Sua forma é fluida e mutável, refletindo tanto a criação quanto a destruição, com cores que se alternam entre chamas escarlates e tons gelados.\r\n\r\nEsse item é capaz de canalizar e manipular as energias universais, permitindo ao portador controlar o equilíbrio entre a criação e a destruição, o caos e a ordem. Ao ser utilizado, o Ginnungagap pode abrir portais para mundos desconhecidos, invocar tempestades de poder imensurável ou restaurar áreas devastadas, dependendo da intenção do portador. Considerado um item de grande responsabilidade, o Ginnungagap é tanto uma fonte de poder quanto um desafio para aqueles que buscam controlar as forças primordiais.', '100000000', 'https://i.imgur.com/QWCtY0d.png', 'Divino'),
	(60, 'O Mal do Armageddon', 'É um artefato apocalíptico, forjado nas profundezas da escuridão, contendo a essência de destruição e caos que ameaça consumir tudo. Sua forma é uma esfera negra, coberta por runas antigas e símbolos de um poder proibido, que emanam uma aura de corrupção e decadência. Esse item carrega consigo a capacidade de desencadear o Armageddon, o fim de todas as coisas, ao invocar forças destrutivas capazes de erradicar mundos inteiros.\r\n\r\nQuando ativado, o Mal do Armageddon pode conjurar cataclismos universais, como terremotos, tempestades devastadoras, e desastres cósmicos, corroendo o equilíbrio entre os reinos. No entanto, seu poder exige um preço terrível, pois o portador se torna gradualmente consumido pela escuridão, perdendo sua humanidade e sendo corrompido pela maldição eterna do item. Somente aqueles com corações de ferro ou intenções de grande maldade podem desejar tal poder, tornando o "Mal do Armageddon" um símbolo de desespero e destruição sem igual.', '100000000', 'https://i.imgur.com/1k7kJDH.png', 'Divino'),
	(61, 'Sumarih_', 'Cabeça do desenvolvedor do servidor!\r\nOriginal: 1', '500000', 'http://cravatar.eu/head/Sumarih_/128.png', 'Raro');
INSERT INTO `ticket_posts` (`id`, `titulo`, `descricao`, `print`, `autor`, `data`) VALUES
	(1, 'Sistema de Raridade de Itens', '*As Origens da Raridade*\r\n\r\nHá muito tempo, antes mesmo da formação dos primeiros reinos, o mundo era governado pelas Forças Primordiais: o Fogo Eterno, a Terra Ancestral, o Vento Celestial e a Água Profunda. Essas forças, embora poderosas, não podiam coexistir em equilíbrio perfeito. Para evitar o caos, elas infundiram sua essência nos elementos materiais do mundo, criando itens únicos e embutindo-os com diferentes níveis de raridade.\r\n\r\nEsses níveis de raridade foram determinados pela quantidade de essência primordial contida no item, gerando categorias distintas: Comum, Raro, Épico, Lendário e o Divino.\r\n\r\n*Os Níveis de Raridade*\r\n\r\n*1° Comum*\r\nOs itens comuns são aqueles que contêm apenas traços residuais da essência primordial. Ferramentas simples, armas rústicas e itens de uso cotidiano pertencem a essa categoria. Embora úteis, não possuem poderes especiais.\r\n\r\n*2° Raro*\r\nEsses itens foram criados em áreas onde as energias primordiais convergiram levemente. Eles brilham sutilmente e muitas vezes possuem habilidades únicas que podem mudar o rumo de uma batalha.\r\n\r\n*3° Épico*\r\nArtefatos épicos são forjados por mestres artesãos ou encontrados em ruínas antigas. Contêm concentrações significativas de energia primordial e são extremamente cobiçados.\r\n\r\n*4° Lendário*\r\nItens lendários são registrados em lendas e canções. Cada um possui uma história única, como a espada que derrotou um dragão ancestral ou o amuleto que salvou um reino da destruição. Sua energia primordial brilha intensamente, e apenas os mais dignos podem usá-los.\r\n\r\n*5° Divino*\r\nEsses itens foram diretamente tocados pelas Forças Primordiais ou criados por divindades. Eles são únicos, carregando poderes além da compreensão mortal. Diz-se que os portadores desses artefatos podem moldar o destino do mundo.\r\n\r\n*O Papel dos Guardiões*\r\n\r\nPara proteger os itens mais raros de caírem em mãos erradas, os Guardiões Primordiais foram criados – entidades semidivinas que vagam pelo mundo. Cada Guardião protege um artefato específico, desafiando qualquer um que ouse tentar reivindicá-lo.\r\n\r\nOs aventureiros que buscam itens raros devem provar sua coragem, força e sabedoria enfrentando esses Guardiões ou explorando locais de grande perigo, onde as energias primordiais ainda fluem com intensidade.\r\n\r\n*A Era Atual*\r\n\r\nNa era presente, o Sistema de Raridade de Itens é um reflexo direto do equilíbrio entre as forças do mundo. Comerciantes, ferreiros e magos estudam o fenômeno para aprimorar seus produtos. Muitos acreditam que encontrar um item Divino pode mudar o curso da história, trazendo glória ou destruição.\r\n\r\nAgora, a escolha está nas mãos dos heróis: buscar a grandiosidade enfrentando os desafios mais mortais ou viver em segurança com o conforto dos itens comuns. Cada item encontrado, cada artefato descoberto, carrega a marca das Forças Primordiais – um fragmento do poder que sustenta o mundo.', 'https://i.imgur.com/4RvRtaY.png', 'Thaynison', '2024-12-20 01:16:31'),
	(2, 'Sistema de Prisão', '*INFORMAÇÕES*\r\n\r\nHá muitos anos, o mundo foi consumido pelo caos, onde regras eram ignoradas e o respeito mútuo era uma memória distante. Para restaurar a ordem, o Conselho da Justiça foi formado por líderes de diversas nações. Eles criaram o sistema de prisão como um pilar para advertir os malfeitores e os quebradores de regras. Este sistema não era apenas um castigo, mas um caminho para reflexão e reabilitação. Cada prisioneiro carregava o peso de suas escolhas e recebia a oportunidade de mudar seu destino. A prisão tornou-se um símbolo de equilíbrio, onde aqueles que desafiaram as leis eram confrontados com suas ações, em um ambiente que visava transformar indivíduos e proteger a sociedade. Assim, a harmonia foi lentamente restaurada, e o respeito às leis tornou-se a base de um novo futuro.', 'https://i.imgur.com/kDefxbO.png', 'Thaynison', '2024-12-25 21:58:02'),
	(3, 'O Conselho da Ordem', '*INFORMAÇÕES*\r\n\r\nO Conselho da Ordem é uma entidade ancestral formada pelos líderes dos clãs mais poderosos. Esses líderes, conhecidos como Guardiões, dedicam suas vidas à proteção dos itens sagrados que sustentam o equilíbrio do mundo. Cada clã, ao longo das eras, trouxe sua força única para o Conselho, fortalecendo sua missão.\r\n\r\nO líder do clã mais poderoso ocupa a posição de Grande Guardião, comandando o Conselho e assegurando que as leis sagradas sejam cumpridas. Sob sua liderança, o Conselho age como o escudo contra o caos, preservando a harmonia e protegendo os segredos dos itens sagrados que, se caírem em mãos erradas, poderão trazer a destruição.\r\n\r\nMisteriosos e reverenciados, os Guardiões raramente interferem no mundo mortal, mas quando o fazem, sua presença ecoa como a última esperança contra a desordem. A Ordem é firme, suas decisões são imutáveis, e sua existência é o alicerce de um mundo em equilíbrio.', 'https://i.imgur.com/hr1flXn.png', 'Thaynison', '2024-12-25 21:59:19');
